const switchMenu = $('#switch-menu');
const navMenu = $('#nav-menu');

switchMenu.click(function(){
    const $this = $(this);
    let h;
    if(navMenu.is(':hidden')){
        h = navMenu.show().height();
        navMenu.css('height', 0);

        navMenu.animate({'height': h}, 500, function(){
            $this.addClass('active');
        });
    } else {
        navMenu.animate({'height': h}, 500, function(){
            $this.removeClass('active');
            navMenu.removeAttr('style').hide();
        });
    }
});


function initMobile() {
    $('body').addClass('is-mobile').removeClass('is-desktop');
    console.log("is-mobile");
}


function initDesktop() {
    $('body').addClass('is-desktop').removeClass('is-mobile');
    switchMenu.removeClass('active');
    navMenu.removeAttr('style');
    console.log("is-desktop");
}


ssm.addState({
    id: 'tablet',
    query: '(max-width: 768px)',
    onEnter: function(){
        initMobile();
    }
});

ssm.addState({
    id: 'desktop',
    query: '(min-width: 768px)',
    onEnter: function(){
        initDesktop();
    }
});

$('.slider').slick({
    slidesToShow: 1,
    slidesToScroll: 1,
    arrows: false,
    dots: true,
    dotsClass: 'dots',
    draggable: true
});

$(".userInput").focus(function () {
    $(this).parent().addClass("focus");
}).blur(function () {
    if ($(this).val() === '') {
        $(this).parent().removeClass("focus");
    }
});
new WOW().init();

function slowScroll(id) {
    var offset = 0;
    $('html, body').animate({
        scrollTop: $(id).offset().top - offset
    },500);
    return false;
}
